import { Spinner, Alert, Badge } from 'react-bootstrap';

const SchedulesTable = ({
  filteredGroupedSchedules = [],
  palette = {},
  cardStyle = {},
  badgeInfo = {},
  badgeSecondary = {},
  actionBtn = {},
  openScheduleDetailsId,
  handleScheduleTitleClick = () => {},
  inlineScheduleList = [],
  inlineScheduleLoading = false,
  getScheduleProgress = () => 0
}) => (
  <section className="mb-4">
    {filteredGroupedSchedules.length === 0 ? (
      <Alert variant="info">No schedules available.</Alert>
    ) : (
      <Table striped bordered hover responsive className="shadow-lg" style={{ borderRadius: 18, overflow: 'hidden', background: palette.card, fontFamily: cardStyle.fontFamily, boxShadow: '0 2px 16px 0 rgba(40,167,69,0.08)' }}>
        <thead style={{ background: palette.primary, color: '#fff', fontSize: '1.15rem', letterSpacing: 1 }}>
          <tr>
            <th style={{ fontWeight: 800, border: 'none' }}>Program</th>
            <th style={{ fontWeight: 800, border: 'none' }}>Weeks</th>
            <th style={{ fontWeight: 800, border: 'none' }}>Total Modules</th>
            <th style={{ fontWeight: 800, border: 'none' }}>No of trainees</th>
          </tr>
        </thead>
        <tbody>
          {filteredGroupedSchedules.map(({ program, schedules }) => {
            const weeksCount = program.weeks_count || 0;
            const modulesCount = (program.modules && Array.isArray(program.modules)) ? program.modules.length : 0;
            const traineesCount = schedules.length;
            return (
              <React.Fragment key={program.id}>
                <tr style={cardStyle}>
                  <td>
                    <span
                      style={{ fontWeight: 500, color: palette.primary, cursor: 'pointer', textDecoration: 'underline' }}
                      onClick={() => handleScheduleTitleClick(program)}
                    >{program.title}</span>
                  </td>
                  <td>{weeksCount}</td>
                  <td>{modulesCount}</td>
                  <td>{traineesCount}</td>
                </tr>
                {openScheduleDetailsId === program.id && (
                  <tr>
                    <td colSpan={4} style={{ background: palette.background, padding: 0 }}>
                      <div style={{ padding: 16 }}>
                        {inlineScheduleLoading ? (
                          <Spinner animation="border" />
                        ) : inlineScheduleList.length === 0 ? (
                          <Alert variant="info">No schedules for this program.</Alert>
                        ) : (
                          <Table striped bordered hover responsive style={{ background: palette.card }}>
                            <thead style={{ background: palette.primary, color: '#fff' }}>
                              <tr>
                                <th>Email</th>
                                <th>Start Date</th>
                                <th>End Date</th>
                                <th>Progress</th>
                                <th>Action</th>
                              </tr>
                            </thead>
                            <tbody>
                              {inlineScheduleList.map(s => {
                                const percent = getScheduleProgress ? getScheduleProgress(s, program.id) : 0;
                                return (
                                  <tr key={s.id}>
                                    <td>{s.email}</td>
                                    <td>{s.start_date}</td>
                                    <td>{s.end_date}</td>
                                    <td>
                                      <Badge style={percent === 100 ? badgeInfo : badgeSecondary}>
                                        {percent}%
                                      </Badge>
                                    </td>
                                    <td>
                                      <Button
                                        size="sm"
                                        style={{ ...actionBtn, color: palette.danger }}
                                        title="Delete this employee schedule"
                                      >
                                        <i className="bi bi-trash"></i>
                                      </Button>
                                    </td>
                                  </tr>
                                );
                              })}
                            </tbody>
                          </Table>
                        )}
                      </div>
                    </td>
                  </tr>
                )}
              </React.Fragment>
            );
          })}
        </tbody>
      </Table>
    )}
  </section>
);

export default SchedulesTable;
